import React, { Component } from 'react';
import {
         Badge,
         CardImg,
         CardText
         } from 'reactstrap';

import Adirasa from "../assets/head.png";

const box = {
  paddingRight: "10px",
  paddingLeft: "10px",
  marginTop: "20px",
  marginBottom: "25px",
  position: "relative",

  fontFamily: "sans-serif",
  textAlign: "center",
}

class CarouselProduct extends Component {
  render () {
    return (
      <div style={box}>
       <CardImg top width="100%" src={Adirasa} alt="Card image cap" />
       <h4 className="text-info" style={box}>Platform Grosir Snack Online</h4>
       <CardText>Kamu Tinggal Pilih Snack Favorite Kamu Dan Fokuskan Waktu Kamu ke Hal Yang Lebih Penting </CardText>
      </div>
    )
  }
}


export default CarouselProduct;
